import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Navbar.css'
import * as Icon from 'react-bootstrap-icons';

import React from 'react';
function App() {  
  const style1={color:"darkgreen",padding:"20px",fontSize:"20px",hover:{color:"white"}};
  const style2={color:"darkgreen",fontSize:"20px",padding:"12px",};
  const [name,setName]=useState("");
  const style3={paddingRight:"0px"};
  return (
    <Navbar className="nav" bg="transparent" expand="md">
      <Container fluid>
        <Navbar.Brand href="/cities">
          <img
            className="rad"
            src={require("./tnrover.png")}
            alt="logo"
            width={150}
          />
        </Navbar.Brand>

        <div
          style={{
            float: "right",
          }}
        >
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav id="menu" className="me-auto">
              <Nav.Link style={style1} href="/cities">
                Home
              </Nav.Link>
              <Nav.Link style={style1} href="/about">
                About
              </Nav.Link>
              <NavDropdown
                bg="light"
                style={style2}
                title="Top Cities"
                id="basic-nav-dropdown"
              >
                <NavDropdown.Item
                  className="block"
                  style={{ fontSize: 20, padding: "1rem" }}
                  href="/chennai"
                >
                  Chennai
                </NavDropdown.Item>
                <NavDropdown.Item
                  className="block"
                  style={{ fontSize: 20, padding: "1rem" }}
                  href="/madurai"
                >
                  Madurai
                </NavDropdown.Item>
                <NavDropdown.Item
                  className="block"
                  style={{ fontSize: 20, padding: "1rem" }}
                  href="#action/3.3"
                >
                  Erode
                </NavDropdown.Item>

                <NavDropdown.Item
                  className="block"
                  style={{ fontSize: 20, padding: "1rem" }}
                  href="/salem"
                >
                  Salem
                </NavDropdown.Item>
              </NavDropdown>
              <Nav.Link style={style1} href="/signup">
                <Icon.Person></Icon.Person>
              </Nav.Link>
              <Nav.Link style={style1} href="/">
                <Icon.DoorOpen></Icon.DoorOpen>
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </div>
      </Container>
    </Navbar>
  );  
}  
export default App;
